Night Raven is investigating the disappearance of numerous superheroines and persons listed on the &quot;Enhanced Meta-Human&quot; directory. HQ has directed her to hide inside an exclusive night club until after closing to see if she can find any clues as many leads indicate suspicious activity. She changes from her undercover party girl dress into her uniform which the agency has stashed for her

Night Raven is taken with a rag by a skilled enemy that got the drop on her. She doesn't drop easy, she is resistant to most incapacitating agents, but this time she is overcome. Night Raven wakes up with warm liquid being poured down her throat and finds herself bound with her number one suspect Gregorian Grigio looming over her

&quot;Do you think you are going to get me drunk?&quot; she asks with confident disdain

But Grigio mocks her, he knows about her super healing and metabolism. But the cocktail he is giving her is harmless...to &quot;real humans&quot; it might as well be club soda. On superheroines it will have the affect of wiping way inhibitions, inducing euphoria, and having agonizing withdrawals. Now Night Raven's powers work against her. her body neutralizes the compound so quickly she goes from lust-filled ecstasy to shivering agony in minutes

She tires to resist but after a while Girgio has her begging for another sip. Over and over she goes through the cycle with Grigio taking greater and greater advantage
